import React from 'react';
import axios from 'axios';
class shortLinkApi extends React.Component {
    componentDidMount() {
        axios.get('https://api.shrtco.de/v2/')
        .then(res => {
            console.log('>>> check res: ', res)
        })
    }
}

export default shortLinkApi;
